-- Table structure for api_logs
-- ----------------------------
DROP TABLE IF EXISTS `api_logs`;
CREATE TABLE `api_logs`  (
  `apilog_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `rpc_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '调用编号',
  `version` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'api版本号',
  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '任务名称',
  `calltime` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '请求时间',
  `status` enum('running','success','fail','sending') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'sending' COMMENT '状态',
  `method` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '方法名',
  `worker` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'api方法名',
  `params` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '任务参数',
  `callback_url` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'callback地址',
  `msg` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '错误原因',
  `response_json` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '返回数据信息',
  `api_type` enum('response','request') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'request' COMMENT '同步类型',
  `retry` mediumint(8) UNSIGNED NULL DEFAULT 0 COMMENT '重试次数',
  `createtime` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '发起同步时间/回应时间',
  `last_modified` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '最后重试时间',
  `next_modified` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '下次重试计划时间',
  `ip` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'ip地址',
  PRIMARY KEY (`apilog_id`) USING BTREE,
  INDEX `ind_status`(`status`) USING BTREE,
  INDEX `ind_calltime`(`calltime`) USING BTREE,
  INDEX `ind_api_type`(`api_type`) USING BTREE,
  INDEX `ind_rpcid`(`rpc_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 855 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for crontab
-- ----------------------------
DROP TABLE IF EXISTS `crontab`;
CREATE TABLE `crontab`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `action` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '执行方法',
  `result` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '未执行' COMMENT '执行方法',
  `enabled` int(1) NOT NULL DEFAULT 1 COMMENT '是否启用',
  `description` varchar(500) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '描述',
  `param` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '参数',
  `schedule` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '时间规则',
  `runtime` int(11) NOT NULL COMMENT '执行时间',
  `createtime` int(11) NOT NULL COMMENT '创建时间',
  `response` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '执行结果',
  `updatetime` int(11) NOT NULL COMMENT '实际执行时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `in_runtime`(`runtime`) USING BTREE,
  INDEX `in_result`(`result`) USING BTREE,
  INDEX `in_enabled`(`enabled`) USING BTREE,
  INDEX `in_action`(`action`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '待执行任务' ROW_FORMAT = Dynamic;

