CREATE TABLE `sys_log`  (
  `id` int(12) UNSIGNED NOT NULL AUTO_INCREMENT,
  `userId` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '用户id',
  `userName` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `realName` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '操作人',
  `model` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模型',
  `mdlName` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '模型描述：操作描述',
  `ip` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'IP',
  `pcName` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电脑名称',
  `optKind` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '操作类型',
  `primaryKey` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '主键字段',
  `primaryValue` int(10) NULL DEFAULT NULL COMMENT '主键值',
  `log` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '修改的详细内容',
