  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ind_time`(`time`) USING BTREE,
  INDEX `ind_ip`(`ip`) USING BTREE,
  INDEX `ind_userId`(`userId`) USING BTREE,
  INDEX `ind_primaryValue`(`primaryValue`) USING BTREE,
  INDEX `ind_userName`(`userName`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1156 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '操作日志' ROW_FORMAT = Compact;

