-- ----------------------------
-- Table structure for sys_msg
-- ----------------------------
DROP TABLE IF EXISTS `sys_msg`;
CREATE TABLE `sys_msg`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `type` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT 'system' COMMENT '消息类型',
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '消息标题',
  `content` varchar(500) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '内容',
  `time` int(11) NOT NULL DEFAULT 0 COMMENT '发送时间',
  `kind` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT 'personal' COMMENT '个人还是全部:personal|all',
  `user_id` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '查看人id',
  `sendWechat` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1已发送',
  `sendSms` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1已发送短信',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ind_type`(`type`) USING BTREE,
  INDEX `ind_time`(`time`) USING BTREE,
  INDEX `ind_user_id`(`user_id`) USING BTREE,
  INDEX `ind_kind`(`kind`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '管理员系统消息' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sys_msg_son
-- ----------------------------
DROP TABLE IF EXISTS `sys_msg_son`;
CREATE TABLE `sys_msg_son`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '读取消息的人id',
  `msg_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '消息主表id',
  `read_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '读取时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uq_umid`(`user_id`, `msg_id`) USING BTREE,
  INDEX `in_msg_id`(`msg_id`) USING BTREE,
  INDEX `in_read_time`(`read_time`) USING BTREE,
  INDEX `in_user_id`(`user_id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '管理员系统消息子表' ROW_FORMAT = Fixed;

-- ----------------------------
-- Table structure for sys_pop
-- ----------------------------
DROP TABLE IF EXISTS `sys_pop`;
CREATE TABLE `sys_pop`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '标题',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `dateFrom` date NOT NULL COMMENT '其实日期',
  `dateTo` date NOT NULL COMMENT '截止日期',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '工具箱中设置的弹窗信息' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for sys_set
-- ----------------------------
DROP TABLE IF EXISTS `sys_set`;
CREATE TABLE `sys_set`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `item` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `itemName` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `value` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `creater` int(10) NOT NULL COMMENT '创建人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 9 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '系统参数设置' ROW_FORMAT = Dynamic;

